[
{"id": 1, "name": "Roecliffe Ponds & Meadows","type": 0, "access": 2, "description": "<b>Note: This is a site of Importance for Nature Conservation</b><br/><br/>Rules<ul class='rule-list'><li>Keep to the footpaths around the ponds. No trespassing from the paths as you will disturb the wildlife.</li><li>NO DOGS allowed at ANY TIME as they will disturb the wildlife.</li><li>NO night fishing (after daylight).</li><li>NO boilies to be used at any time.</li><li>NO camping or fires of any kind.</li><li>NO fish to be taken for any purpose.</li><li>Fishing from permanent pegs only.</li></ul><br/>Fishing visitors are allowed but only with a full or associate member who must have obtained a guest ticket in advance and the counterfoil must be signed by the club member.<br/><br/>When asked to produce your book for proof of membership, you will also be asked to show your numbered gate key.<br/><br/>Any person failing to produce a valid gues ticket or their member's book on request, will be ordered off the site.<br/><br/>On occasion the pond may be closed for educational visits.","species": "Bream, Carp, Tench, Roach, Ide, Perch", "directions": "Entry is via first lane on the left after Beckland's Industrial Estate, then right at the end.<br/><br/>Park in the fenced-off area taking care not to obstruct the public footpath. Use your keys to enter the ponds through the small gate. If you are a disables angler - open the large gate and park inside. <br/><br/>Please LOCK the gate after each entry and exit.","destination": [54.0874351912413,-1.41015610915912], "markers": [54.0874351912413,-1.41015610915912], "markericons": ["car"], "markerlabels": ["Car Park"], "path": [54.09028216911475,-1.4096897976558265,54.08777187425186,-1.40883844645209,54.0874351912413,-1.41015610915912]},
{"id": 1.2, "name": "River Ure - Ellenthorpe Lodge","type": 1, "access": 0, "description": "<b>UNDER NO CIRCUMSTANCES</b> must any member call or disturb the Lister family.<br/><br/>Left bank downtream only.<br/><br/>Rules: -<ul class='rule-list'><li>No entry through farm buildings.</li><li>Observe any contamination precautions.</li><li>Drive slowly and quietly past house.</li><li>Observe notice boards at the limit of the stretch.</li></ul>","species": "Barbel, Chub, Dace, Bream, Roach, Perch, Pike", "directions": "Entrance at Ellenthorpe Lodge. Park at the bottom of the lane tight into the fence in front of flood bank, leaving the gateway free. You can also park on the large concrete apron 100 metres from the riverbank.","destination": [54.0944216976912,-1.35441129713989], "markers": [54.0944216976912,-1.35441129713989,54.09129030814451,-1.3557096073417747], "markericons": ["car","car"], "markerlabels": ["Apron Parking","Floodbank Parking"], "path": [54.09854552896066,-1.3566517594183949,54.098619403522044,-1.3574361664261485,54.0981243068151,-1.3576197766917981,54.09800493965223,-1.3569713724788648,54.098078766578595,-1.356526231964259,54.097495980044776,-1.3535008887781306,54.0944216976912,-1.35441129713989,54.09129030814451,-1.3557096073417747]},
{"id": 2, "name": "River Swale - Ellenthorpe Lodge","type": 1, "access": 0, "description": "<b>UNDER NO CIRCUMSTANCES</b> must any member call or disturb the Lister family.<br/><br/>Left bank downtream only.<br/><br/>Rules: -<ul class='rule-list'><li>No entry through farm buildings.</li><li>Observe any contamination precautions.</li><li>Drive slowly and quietly past house.</li><li>Observe notice boards at the limit of the stretch.</li></ul>","species": "Barbel, Chub, Dace, Bream, Roach, Perch, Pike", "directions": "Entrance at Ellenthorpe Lodge. Park on the large concrete apron or proceed through the first apron to a smaller concrete apron before the flood bank. Avoid walking through any game rearing crops.","destination": [54.0944216976912,-1.35441129713989], "markers": [54.0944216976912,-1.35441129713989,54.09332901834802,-1.347976831185752,54.0919538866505,-1.344047548672633], "markericons": ["car","car","limit"], "markerlabels": ["Large Apron Parking","Small Apron Parking","Limit of stretch"], "path": [54.09854552896066,-1.3566517594183949,54.098619403522044,-1.3574361664261485,54.0981243068151,-1.3576197766917981,54.09800493965223,-1.3569713724788648,54.098078766578595,-1.356526231964259,54.097495980044776,-1.3535008887781306,54.0944216976912,-1.35441129713989,54.09332901834802,-1.347976831185752]}
]

